var title_f21_27_21938="Port placement splenectomy";
var content_f21_27_21938=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F79408&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F79408&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 477px\">",
"   <div class=\"ttl\">",
"    Port placement splenectomy*",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 457px; height: 587px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An open technique is used to enter the peritoneal cavity at the umbilicus (enlarged spleen) or in the subcostal location (normal-sized spleen). A 5 to 12 mm Hasson trocar is placed. A port is placed in the left flank region in the anterior axillary line between the left subcostal margin and the left iliac crest. This port is used to pass a stapler to transect the hilar vessels after dissection has been completed. Two additional 5 mm ports are placed for dissection and counter-traction. After the hilum has been transected and the perisplenic attachments divided, the spleen is captured into a large laparoscopic bag placed through the primary port site and removed by morselization (cutting it up). Alternatively, if the integrity of the spleen is important for pathologic analysis, a mini-laparotomy is performed.",
"    <div class=\"footnotes\">",
"     * Port placement and technique may vary amongst laparoscopic surgeons.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
