var title_f21_27_21944="Posterior cervical line C1 C3";
var content_f21_27_21944=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F63065&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F63065&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 560px\">",
"   <div class=\"ttl\">",
"    Posterior cervical line drawn between the anterior aspects of the C1 and C3 spinous processes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 540px; height: 584px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Posterior cervical line of Swischuk. Line is drawn from the cortex of the spinous process of C1 to the cortex of the spinous process of C3. Relationship of the line to cortex of the spinous process of C2 is noted. If the line is situated more than 2.0 mm anterior to the cortex of the spinous process of C2, underlying cervical pathology should be present. This line should be used only with anterior displacement of C2 on C3.",
"    <br>",
"     (B) Pseudosubluxation of C2 on C3 with normal posterior cervical line in a 2-year-old child. Note apparent widening of prevertebral soft tissue.",
"     <br>",
"      (C) Abnormal posterior cervical line with an underlying hangman's fracture. Actual offset is 4 mm.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Reproduced with permission from: Woodward GA. Neck trauma. In: Fleisher GR, Ludwig S. Textbook of Pediatric Emergency Medicine, 6th edition, Lippincott Williams and Wilkins, Philadelphia, 2010. Copyright &copy; 2010 Lippincott Williams &amp; Wilkins.",
"      </div>",
"      <div class=\"contractual\">",
"       <br/>",
"       <a href=\"file://www.lww.com\">",
"        file://www.lww.com",
"       </a>",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
