"    Light micrograph showing crescentic glomerulonephritis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High-power light micrograph in crescentic glomerulonephritis. The hypercellular circumferential crescent (arrows) is compressing the glomerular tuft in the center of the glomerulus and closing the capillary lumens.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
