var title_f21_27_21949="Behavior rating scales";
var content_f21_27_21949=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F81675&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F81675&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Ratings scales in the assessment and monitoring of ADHD",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Scales",
"       </td>",
"       <td class=\"subtitle1\">",
"        Behaviors assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Broadband assessment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Conners' Rating Scale (revised): Long form",
"        <sup>",
"         [1]",
"        </sup>",
"       </td>",
"       <td>",
"        Combined measure of ODD, cognitive problems, hyperactivity, anxiousness/shyness, perfectionism, social problems, psychosomatic illnesses, restlessness/impulsiveness, emotional lability, DSM-IV symptoms scale, DSM-IV inattentive, DSM-IV hyperactive-impulsive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Behavior Assessment System for Children (BASC)",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"       <td>",
"        Hyperactivity, aggression, conduct problems, anxiety, depression, somatization, atypicality, withdrawal, attention problems, learning problems, lack of adaptability/social/leadership/study skills",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Child Behavior Checklist/Teacher Report Form",
"        <sup>",
"         [3,4]",
"        </sup>",
"       </td>",
"       <td>",
"        Somatic complaints, social/thought/attention problems, anxiety/depression, aggressive/delinquent behavior, withdrawal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Narrow-band assessment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        ADHD Comprehensive Teacher's Rating Scale (ACTeRS): Boys' and girls' form",
"        <sup>",
"         [5]",
"        </sup>",
"       </td>",
"       <td>",
"        Attention problems, hyperactivity, lack of social skills, oppositional",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        ADHD Rating Scale",
"        <sup>",
"         [6]",
"        </sup>",
"       </td>",
"       <td>",
"        Symptoms of ADHD according to DSM-IV criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Childhood Attention Problems Scale",
"        <sup>",
"         [7]",
"        </sup>",
"       </td>",
"       <td>",
"        Combined measure of attention problems, impulsivity, hyperactivity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Conners' Rating Scale (revised): Short form",
"        <sup>",
"         [1]",
"        </sup>",
"       </td>",
"       <td>",
"        Combined measure of ODD, cognitive problems, hyperactivity, ADHD index",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        BASC Monitor Rating Scale",
"        <sup>",
"         [8]",
"        </sup>",
"       </td>",
"       <td>",
"        Attention/adaptive problems, hyperactivity, problems with internalizing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Disruptive Behavior Rating Scale",
"        <sup>",
"         [9]",
"        </sup>",
"       </td>",
"       <td>",
"        DSM-IV symptoms of ODD, ADHD, and CD (parent form only)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vanderbilt Assessment Scales",
"        <sup>",
"         [10,11]",
"        </sup>",
"       </td>",
"       <td>",
"        Symptoms of ADHD according to DSM-IV criteria; screen for comorbid conditions (ODD, CD, anxiety, depression)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Assessment of medication side effects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Side Effects Rating Scale",
"        <sup>",
"         [9]",
"        </sup>",
"       </td>",
"       <td>",
"        Sleeping/appetite problems, staring/daydreaming, withdrawal, anxiety, irritability, somatic complaints, emotional lability, dizziness, tics",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ADHD: attention-deficit hyperactivity disorder; ODD: oppositional-defiant disorder; DSM-IV: Diagnostic and Statistical Manual of Mental Disorders, fourth edition; CD: conduct disorder.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Conners CK. Conners 3rd Edition. Toronto, Multi-Health Systems, Inc., 2008.",
"      </li>",
"      <li>",
"       Reynolds CF, Kamphaus RW. Behavior Assessment System for Children-Second Edition. Minneapolis, MN, NC Pearson, Inc., 2004.",
"      </li>",
"      <li>",
"       Achenbach TM. Manual for the Child Behavior Checklist. University of Vermont, Department of Psychiatry, Burlington, 1991.",
"      </li>",
"      <li>",
"       Achenbach TM. Manual for the Teachers Report Form. University of Vermont, Department of Psychiatry, Burlington, 1991.",
"      </li>",
"      <li>",
"       Ullmann RK, Sleator EK, Sprague RL. A new rating scale for diagnosis and monitoring of ADD children. Psychopharmacol Bull 1984; 20:160.",
"      </li>",
"      <li>",
"       DuPaul GJ. Parent and teacher ratings of ADHD symptoms: Psychometric properties in a community based sample. J Clin Child Psychol 1991; 20:242.",
"      </li>",
"      <li>",
"       Edelbrock C. Child Attention Problems Scale (unpublished manuscript). Penn State University, University Park, 1978.",
"      </li>",
"      <li>",
"       Kamphaus RW, Reynolds CR. BASC Monitor for ADHD: Manual and Software Guide. American Guidance Service, Circle Pine, MN 1998.",
"      </li>",
"      <li>",
"       Barkley RA, Murphy KR. Attention Deficit Hyperactivity Disorder: A Clinical Workbook. Guilford Press, New York 1998.",
"      </li>",
"      <li>",
"       Wolraich ML, Feurer ID, Hannah JN, et al. Obtaining systematic teacher reports of disruptive behaviors utilizing DSM-IV. J Abnorm Child Psychol 1998; 26:141.",
"      </li>",
"      <li>",
"       Wolraich ML, Lambert W, Doffing MA, et al. Psychometric properties of the Vanderbilt ADHD diagnostic parent rating scale in a referred population. J Pediatr Psychol 2003; 28:559.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
